import React from 'react'
export const input = (array) => array.map((data) => {
    return (
        <div>
            <input type="radio"
                id={data.id}
                name={data.name}
                value={data.value}
                onChange={this.selectedChangeOrigem}
            />
            <label class="property-options" for={data.id}
                >{data.children}</label>
        </div>
    )
})
